--
-- Table structure for table `om_country`
--

DROP TABLE IF EXISTS `om_country`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `om_country` (
  `id` int(10) unsigned NOT NULL,
  `a2` char(2) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `a3` char(3) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `num` char(3) COLLATE utf8mb4_bin DEFAULT NULL,
  `tier` tinyint(3) unsigned DEFAULT '1' COMMENT 'Tier Group',
  `continent` varchar(2) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '所属洲',
  `capital` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '首都',
  `dcenter` tinyint(3) NOT NULL DEFAULT '1' COMMENT '数据中心,1:US,2:SG,3:DE',
  `name` varchar(100) COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT 'Name',
  `name_cn` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL,
  `store_front_id` int(10) NOT NULL DEFAULT '0' COMMENT 'AppStoreFrontID',
  `area` int(11) NOT NULL DEFAULT '0' COMMENT 'Area(in sq km)',
  `population` int(11) NOT NULL DEFAULT '0',
  `main_lang` varchar(10) COLLATE utf8mb4_bin NOT NULL DEFAULT '',
  `muti_lang` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'lists the languages spoken in a country ordered by the number of speakers. The language code is a ''locale'' ',
  `tld` varchar(5) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Top Level Domain',
  `tz` tinyint(3) NOT NULL DEFAULT '0',
  `time_zones` text COLLATE utf8mb4_bin COMMENT '国家对应的时区,json格式. 例: [{"name":"Asia/Shanghai","rate":30}]',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `lastmodify` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `a2` (`a2`),
  UNIQUE KEY `a3` (`a3`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;
/*!40101 SET character_set_client = @saved_cs_client */;

